NGKプラグコードは金属抵抗巻線で抵抗値が安定しており、コード本来の機能である伝送性能に優れています。また、エンジンの点火系から発生するノイズに起因する電波障害を防止し、バランスの取れた設計でエンジン電子機器の保護、カーオーディオ・カーナビ・カー無線機等に入る点火ノイズを抑えます。 <br><br>一般のコード（16kΩ/m）に比べて抵抗値が1/2の8kΩ/mとロスが少なく伝送性能が優れています。金属抵抗線をフェライト芯上に粗密交互に巻いたバリアブルピッチ巻とし、その上に特殊な絶縁被覆をした構造となっています。耐熱ゴムを採用。特に耐熱性が求められる機種用には、シリコンゴムを使用。どんな運転条件でも使用できます。<br><br>※画像はイメージでコードの本数や長さは実際の商品と異なります。 <br><br>対応車種：SV30 ビスタ (エンジン型式：4S-FE 排気量：1800cc 年式：H4.6～H6.6） <br><br>車検対応品<br>※エンジン型式により細かく適合が分れておりますので、ご購入の際はエンジン型式を御入力下さい。<tr><td colspan="2">
